import React from "react";
import DeleteForeverIcon from '@material-ui/icons/DeleteForever';
import Button from '@material-ui/core/Button';
const Note = () =>{

    return(

        <>
        <div className="col-lg-4">
        <div className="content" style={{ width:"15%", marginLeft:"30px"}}>
        <div>
            <h1 className="title">Title</h1>
        </div>
        <ol><li>
            Hello all
        </li></ol> 
        <button className="button"><DeleteForeverIcon fontSize="small"/></button>
    </div> 
    </div>      

        </>
    );
}
export default Note;
